CREATE DEFINER=`root`@`localhost` FUNCTION `fn_retorna_cumplimiento`(id_cliente int, fecha_s date) RETURNS double
BEGIN
declare id_dieta_asig int;
declare fecha_max datetime;
declare cumplimiento double;

select max(fecha) into fecha_max from cliente_dieta where id_cliente = id_cliente;

select id_dieta  into id_dieta_asig from  cliente_dieta x  
where id_cliente = id_cliente
and  fecha  = fecha_max;

/*query de cumplimiento*/

select
ifnull(avg( x.cumplimiento),0) into cumplimiento
from
(
select 
s.id_comida
,s.id_categoria
,s.porciones
,s.cantidad 
,case when s.porciones = 0 and s.cantidad = 0
then  null
else
		case 
		when s.porciones = s.cantidad  then 1 
		else 0 
		end 

end  cumplimiento
from
(
select 
a.id_comida
,a.id_categoria
,a.porciones
,case when b.cantidad is null then 0 else b.cantidad end cantidad
from 
(
select b.id_comida,b.id_categoria,sum(b.porciones) porciones
from cliente_dieta x 
inner join dieta_cabecera a on  x.id_dieta = a.id_dieta
inner join  dieta_detalle b  on a.id_dieta = b.id_dieta
where a.id_dieta = id_dieta_asig
and x.id_cliente = id_cliente
and x.fecha = fecha_max
group by b.id_comida,b.id_categoria
order by b.id_comida,b.id_categoria
) a
left join 
(select b.id_comida,c.categoria_id,sum(b.cantidad)  cantidad
from contador_calorias_cabecera a 
inner join contador_calorias_detalle b on a.id_cabecera = b.id_cabecera
inner join alimentos l on b.ID_ALIMENTO = l.ID_ALIMENTO 
inner join sub_categoria s on l.ID_SUBCATE = s.sub_cate_id
inner join categoria c on s.categoria_id = c.categoria_id 
where a.fecha =  fecha_s
and a.id_cliente  = id_cliente
group by b.id_comida,c.categoria_id
order by b.id_comida,c.categoria_id
) b on a.id_comida = b.id_comida and a.id_categoria =  b.categoria_id
order by a.id_comida
,a.id_categoria
) s
) x;


RETURN cumplimiento;

END ;;
DELIMITER ;
