CREATE DEFINER=`root`@`localhost` FUNCTION `fn_retorna_promedio_calorias`(id_dieta int) RETURNS double
BEGIN

declare  result double;


select 
sum(j.total_calorias) into result
from (
select 
  xy.id_comida
, xy.id_categoria 
, xy.porsiones
, xy.Calorias
, (xy.porsiones * xy.Calorias) total_calorias
from(
select  
c.id_comida
,c.id_categoria 
,sum(c.porciones) porsiones
,avg(p.Calorias) Calorias
from 
 dieta_cabecera  x 
inner join dieta_detalle  c on x.id_dieta = c.id_dieta 
inner join 
(
select a.categoria_id,avg(c.Calorias)  Calorias
from  categoria a 
inner join sub_categoria b on a.categoria_id = b.categoria_id
inner join alimentos c on b.sub_cate_id = c.ID_SUBCATE
group by a.categoria_id
) p on p.categoria_id = c.id_categoria 
where x.id_dieta =id_dieta  
group by c.id_comida
,c.id_categoria 
order by c.id_comida
,c.id_categoria 
) xy
) j;



RETURN result;
END ;;
DELIMITER ;
