				select (contador + 1) into contador from dual;

				update sesion set ip = v_ip, fecha_hora = now(),nom_maquina = v_nom_maq,num_conect = contador, estado = 1
				where id_cliente = v_id_cliente;
                
           
		 else 
					update sesion set ip = v_ip, fecha_hora = now(),nom_maquina = v_nom_maq,num_conect = contador, estado = 0
						where id_cliente = v_id_cliente;
				
			 
		end if;                 
                        
END IF;

select max(num_conect) into result from sesion where id_cliente = v_id_cliente;

RETURN result;
END ;;
